import React from 'react'

const DUMMY_MEALS = [
    {
      id: 'm1',
      name: 'Sushi',
      description: 'Finest fish and veggies',
      price: 22.99,
    },
    {
      id: 'm2',
      name: 'Schnitzel',
      description: 'A german specialty!',
      price: 16.5,
    },
    {
      id: 'm3',
      name: 'Barbecue Burger',
      description: 'American, raw, meaty',
      price: 12.99,
    },
    {
      id: 'm4',
      name: 'Green Bowl',
      description: 'Healthy...and green...',
      price: 18.99,
    },
  ];

const MealsListItems = () => {
    const listItems = DUMMY_MEALS.map((element) => {
        return <li className='block font-bold' key={element.id}>{element.name}<span className='block'>{element.description}</span></li>
    })
  return (
    <>
    {listItems}
    </>
  )
}

export default MealsListItems
